import React from 'react';
import ProjectsPanel from './ProjectsPanel';

function GamifiedLayout() {
  return (
    <div className="columns is-gapless is-multiline gamified-layout">
      {/* LEFT PANEL */}
      <div className="column is-3 panel-like">
        <div className="mb-4">
          <img 
            src="https://via.placeholder.com/80" 
            alt="Avatar" 
            style={{ borderRadius: '50%' }}
          />
        </div>
        <h2 className="title-retro">Daniel Nnodim</h2>
        <button className="button is-info mb-3">Contact Me</button>
        <p className="mb-2">Roles / Toggles:</p>
        <div>
          <button className="button is-small is-dark is-rounded mb-1 mr-1">Developer</button>
          <button className="button is-small is-dark is-rounded mb-1 mr-1">Econ Analyst</button>
        </div>
      </div>

      {/* CENTER PANEL */}
      <div className="column is-6 panel-like has-text-centered">
        <h2 className="title-retro">Portfolio</h2>
        <p>Browse My Portfolio</p>
        <div className="center-console">
          <p className="has-text-grey">[ Larger content preview area ]</p>
        </div>
      </div>

      {/* RIGHT PANEL - Our Projects / side icons */}
      <div className="column is-3 panel-like">
        <h2 className="title-retro">Projects</h2>
        <ProjectsPanel />
      </div>
    </div>
  );
}

export default GamifiedLayout;
